import React from 'react';
import PropsTile from './PropsTile'



const FaceRecognition = ({imageUrl, namesList, faceRec, Boxes}) => {

    const Draw = namesList.map((object , i) => {
        return <PropsTile key={i} name={namesList[i].name}/>
    });

    if(faceRec === false){
        return(
        <div className=' cf flex flex-wrap justify-center ma3'>

            <div className='br3 w-30 pa3'>
                <img className='br3 shadow-1' src={imageUrl} alt='Your Image Should Appear Here' />


            </div>
            <div className=' flex flex-wrap w-50 pa3 '>
                <div>I would guess that this is an image that could be classified by the following traits.</div>
                {Draw}
            </div>
        </div>
    )}

    else if(faceRec === true){
        return(
            <div className=' cf flex flex-wrap justify-center ma3'>
                <div className='br3 pa3 w-50 absolute'>
                    <img id='inputimage' className='br3  shadow-1' src={imageUrl} alt='Your Image Should Appear Here' />
                    <p></p>
                    {/* <div className='absolute shadow-1 flex flex-wrap justify-center' style={{top: Boxes.topRow}}></div> */}
                </div>
            </div>
        );
    }
    };


export default FaceRecognition;
